import Link from "next/Link";
const Navbar = () => {
  const styles = {
    display: "flex",
    background: "grey",
    justifyContent: "space-between",
    padding: "1rem",
  };
  return (
    <div style={styles}>
      <Link href="/">
        <button>Home</button>
      </Link>
      <Link href="/about">
        <button>AboutPage</button>
      </Link>
      <Link href="/contact">
        <a>ContactPage</a>
      </Link>
    </div>
  );
};

export default Navbar;
